import React from 'react';

const EventDetail = ({eventname, eventurl}) => {
	if(!eventname) {
		return <div>Loading...</div>;
	}


	return (
		<div>
			<a href={eventurl}>{eventurl}</a>
		</div>
	);
}

export default EventDetail;
